import React from 'react';

function ImagePopup() {
    return(
        <div className="popup popup-zoom">
            <figure className="popup-zoom__figure">
                <button type="button" name="image-close-button" className="popup__close-button popup-zoom__close-button"></button>
                <img className="popup-zoom__image" alt="#" src="#" />
                <h4 className="popup-zoom__name"></h4>
            </figure>
        </div>
    );
}

export default ImagePopup;
